import React from "react";
import '../styles/contact.css'

const contactDeets = [
    {
        method: "E-mail",
        link: "eschase4@gmail.com",
    },
    {
        method: "LinkedIn",
        link: "https://www.linkedin.com/in/eli-chase-16b146256/",
    },
    {
        method: "GitHub",
        link: "https://github.com/eschase4",
    },
]

function Contact() {
    return (
        <div id="contact">
            <div class="container">
                <div class="titleCard">
                    <h3>Contact</h3>
                </div>
                <div class="emailForm">
                    <h4>Email</h4><br />
                    <p>Name:</p><input type="" placeholder="Insert Your Name"></input>
                </div>
                <div>
                    <ul>
                        {contactDeets.map((item) => {
                            return (
                                <li><a href={item.link}>{item.method}</a></li>
                            )
                        })}
                    </ul>
                </div>
            </div>
        </div>
    )
}

export default Contact
